/* Child and page sizes. */
typedef unsigned char child_s;
typedef unsigned char page_s;

/* Int as pointers. */
typedef unsigned short char_p;
typedef unsigned short child_p;
typedef unsigned short page_p;

/* A node of the Radix tree. */
struct Node {
    char_p chars;
    child_p children;
    page_p pages;
    /* The number of children. */
    child_s child_count;
    /* The number of pages. Is zero when this node is not an end. */
    page_s page_count;
};

/* Struct storing the data associated with a page. */
struct Page {
    short page_index;
    short count;
};

